import React from 'react';
import styles from '../styles/styles.css'
const ScoreBoard = props => {
    return(
        <div class = "scoreboard-headline-wrapper">
            <div class = "scoreboard-text">{props.title}</div>
        </div>
    )
}
export default ScoreBoard
